import React from 'react';// JavaScript Document
import './CSS/blog.css';
import image from "../assests/retire.png";
import { Link } from "react-router-dom";


function blog() {
	return(
	<>
  <div className="blog-card">
    <div className="inner-part">
      <label for ="" className="img">
        <img src={image} ></img>
      </label>
    </div>

  </div>



	</>
     )
};

export default blog;
